import Registrar from './components/Registrar.js';
import Login from './components/Login.js';
import './style/Login.css';
import './style/Registrar.css'
import Logo from './imagens/'



function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Login/>
        <Registrar/>
      </header>
    </div>
  );
}

export default App;
